import MapComponent from "./MapComponent"

const Transport = () => {
  const view ={
    lon:90.41607886403209,
    lat:23.79399061856948,
    zoom:12,
    projection:'EPSG:4326'
   }
  return (
    <MapComponent
    view={view} 
    layers={[]}/>
  )
}

export default Transport
